import React from "react";
function NavItem(props) {
  const { label, link } = props;
  return (
    <li>
      <a>{label}</a>
    </li>
  );
}
export default function Header() {
  return (
    <header>
      <nav className={"flex items-center content-between"}>
        <div style={{ height: 80, width: 80, background: "black" }}></div>
        <ul className={"flex-1 flex content-center gap-16 justify-center"}>
          <NavItem label={"Work"} />
          <NavItem label={"Experiments"} />
          <NavItem label={"About"} />
          <NavItem label={"Resume"} />
        </ul>
        <div style={{ width: 160, height: 24, background: "black" }}></div>
      </nav>
    </header>
  );
}
